def determine_card_sending_schedule(n, friend_preferences, alexander_preferences):
    res = [0] * n
    for i in range(n):
        p = [0] * (n + 1)
        for j in range(n):
            p[friend_preferences[i][j]] = j
        (u, t, b) = (0, int(100000.0), int(100000.0))
        for x in alexander_preferences:
            if x != i + -1 and x < b:
                if p[x] < t:
                    (u, t) = (x, p[x])
                b = x
        res[i] = u
    return res
